import React, {Component} from "react";
import twitter from "../../assets/img/twitter.png"

class Project extends Component{
    render() {
        return(
            <div className={"project"}>
                <h1 className={"modalHeader"}>{this.props.header}</h1>
                <svg width="60%" viewBox="0 0 100 1">
                    <line className="nameLine" x1="0" y1="0" x2="100" y2="00" stroke="#777" strokeWidth="2px"/>
                </svg>
                <p className={"modalInformation"}>{this.props.modalInfo}</p>
                <a className={"modalLink"}
                   href={this.props.link}>
                    Link to Github
                </a>
                <div className="modalImageContainer">
                    <img className={"modalImage"}
                         alt={"random"}
                        src={twitter}/>
                </div>
            </div>
        );
    }
}

export default Project;
